103 minuten

geregisseerd door Barry Sonnenfeld
met Will Smith, Josh Brolin en Tommy Lee Jones

In Men in Black III gaan Agenten J (Will Smith) en K (Tommy Lee Jones) terug... in de tijd. In zijn vijftien jaar bij de Men in Black heeft J heel wat onverklaarbare dingen gezien, maar niets of niemand slaat hem met zoveel verstomming als zijn norse, terughoudende partner. Wanneer het leven van K en het lot van de planeet op het spel staan, zal Agent J terug in de tijd moeten reizen om de dingen recht te zetten. J ontdekt dat het universum geheimen herbergt waarover K hem nooit verteld heeft - geheimen die zich zullen openbaren als hij samen met de jonge Agent K (Josh Brolin) zijn partner, het agentschap, en de toekomst van de mensheid probeert te redden.



